import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Logo extends Component {
  render() {
    if (this.props.flat) {
      return (
        <div className="Logo">
          <Link to={this.props.to ? this.props.to : '/'}>
            <div
              style={{
                display: 'flex',
                justifyContent: this.props.center ? 'center' : 'flex-start',
                // width: "100%",
                marginBottom: 0,
              }}
            >
              <img
                alt="horizontal logo"
                src={require('assets/horizontal.png')}
                style={{ width: '200px' }}
              />
            </div>
          </Link>
        </div>
      );
    }

    return (
      <div className="Logo">
        <Link to={this.props.to ? this.props.to : '/'}>
          <img
            alt="logo"
            src={
              this.props.login
                ? require('assets/loginlogo.png')
                : require('assets/textlogo.png')
            }
            style={{ maxWidth: '460px', width: '100%' }}
          />
        </Link>
      </div>
    );
  }
}
